namespace EMPORIKO\Libraries\Auth;

use EMPORIKO\Helpers\Arrays as Arr;
use EMPORIKO\Helpers\Strings as Str;
use CodeIgniter\HTTP\RequestInterface;

class FormAuth
{
	
	public $session;
	
	public $authTokenName;
	
	private $cryptor;
	
	private $sessionTime;
	
	private $csrf_token;
	
	private $modelUsers;
	
	private $showErrorMsg;
	
	private $errorRedirect;
	
	private $successRedirect;
	
	private $timeFormat;
	
	private $userAvatar='data:image/png;base64,';
	
        public static function init()
        {
            return new \EMPORIKO\Libraries\Auth\FormAuth([]);
        }
        
        function __construct(array $config=[])
	{
		$this->session = \Config\Services::session();	
		$this->cryptor=\Config\Services::encrypter();
		$this->sessionTime=array_key_exists('sessionTime', $config)?$config['sessionTime']:config('App')->authTokenExpiry;
		$this->authTokenName=array_key_exists('sessionTokenName', $config)?$config['sessionTokenName']:config('App')->authTokenName;
		$this->csrf_token=csrf_token();
		
		$this->modelUsers=model('Auth/UserModel');
		
		$this->showErrorMsg=array_key_exists('showErrorMsg', $config)?$config['showErrorMsg']:1;
		$this->errorRedirect=array_key_exists('errorRedirect', $config)?$config['errorRedirect']:config('App')->authRedirectUrls['error'];
		$this->successRedirect=array_key_exists('successRedirect', $config)?$config['successRedirect']:config('App')->authRedirectUrls['success'];
		$this->timeFormat=array_key_exists('timeFormat', $config)?$config['timeFormat']:'YmdHis';
		
	}
	
        
	public function isLoged()
	{
		if ($this->authTokenName==null||($this->authTokenName!=null && !$this->session->has($this->authTokenName)))
		{
			return FALSE;
		}
		$user=$this->decryptSessionToken();
		$loged=\DateTime::createFromFormat($this->timeFormat, $user['lastlogin']);
		$loged->modify('+'.($this->sessionTime/60).' minutes');
		$loged=$loged->format($this->timeFormat);
		
		if (date($this->timeFormat)>$loged)
		{
			return FALSE;
		}
		
		$arr=$this->modelUsers->find($user['userid']);
		
		if (!array_key_exists('enabled', $arr) || (array_key_exists('enabled', $arr) && $arr['enabled']==0))
		{
			if (is_array($user))
			{
				$this->session->removeTempdata($this->authTokenName);
			}	
			return FALSE;
		}
		
		return TRUE;
	}

	public function getLogedUserInfo($info=null,$noChekc=FALSE)
	{
            if ($info=='auth')
            {
                return $this;
            }
		$arr=$this->isLoged();
		
		if (!$arr)
		{
			$arr= 
			[
				'name'=>'guest',
				'username'=>'guest',
				'email'=>'',
				'avatar'=>'',
				'lastlogin'=>date($this->timeFormat),
				'access'=>0,
				'interface'=>0
			];
		}else
		{
			$arr=$this->decryptSessionToken();
			$arr=$this->modelUsers->getUserBasicData($arr['userid']);
		}
		
		if (strlen($arr['avatar'])<2)
		{
                    default_avatar:
                   $arr['avatar']='data:image/jpeg;base64,'.createDefaultAvatar($arr['name']);
		} else 
                {
                    if (Str::isJson($arr['avatar']))
                    {
                        $arr['avatar']= json_decode($arr['avatar'],TRUE);
                        if (!is_array($arr['avatar']) || (is_array($arr['avatar']) && count($arr['avatar']) < 1))
                        {
                            goto default_avatar;
                        }
                        $arr['avatar']= array_values($arr['avatar']);
                        $arr['avatar']=$arr['avatar'][0];
                    }
                   
                    if (!file_exists(parsePath($arr['avatar'],TRUE)))
                    {
                        goto default_avatar;
                    }
                    
                    $arr['avatar']=protected_link(parsePath($arr['avatar']),TRUE);
                }
                
		if ($info!=null)
		{
			if (array_key_exists($info, $arr))
			{
				$arr=$arr[$info];
			}else
			{
				$arr=null;
			}
		}
		return $arr;
	}
	
	function authenticate(RequestInterface $request)
	{
		
		helper('text');
		helper('form');
		$error='';
		if ($request->getMethod()=='post')
		{
			$post=$request->getPost();
			if (array_key_exists('action', $post))
			{
				if ($post['action']=='login')
				{
					$msg=$this->Login($post);
					if (!$msg)
					{
                                                $error=$this->session->getFlashdata('error_login');
						$error=createErrorMessage($error!=null && strlen($error) > 0 ? $error :'system.auth.loginform_error','danger'); 
					}
					//model('System/MovementsModel')->addItem(0,$post['login'],current_url(),null,$post['login'],'login',null,'user');
				}else
				if ($post['action']=='forget' && array_key_exists('email', $post))
				{
					$msg=$this->generateForgetKey($post['email']);
					$msg=FALSE;
					$error=createErrorMessage('system.auth.forget_reset_conf_msg','info');
				}else
				if ($post['action']=='recover' && array_key_exists('key', $post) && array_key_exists('password', $post))
				{
					$msg=$this->decodeForgetKey($post['key']);
                                        if (is_array($msg))
                                        {
                                            $msg=$this->modelUsers->clearResetKey($msg['userid'],$post['password']);
                                        } else 
                                        {
                                            $msg=TRUE;
                                        }
					$this->logout(FALSE,FALSE);
					if (!$msg)
					{
                                            header('Location: '.site_url());
                                            return redirect()->to(site_url())->with('error',createErrorMessage('system.auth.recover_reset_error','danger'));
					}else
					{
                                                header('Location: '.site_url());
						return redirect()->to(site_url())->with('error',createErrorMessage('system.auth.recover_reset_ok','success'));
					}
				}//
			}else
			{
				$msg=FALSE;
				$error=createErrorMessage('system.auth.loginform_error','danger');
			}
			if ($msg)
			{
                            return redirect()->to(array_key_exists('refurl', $post) ? base64url_decode($post['refurl']) :site_url());// : 
			}
		}
		
		$view=new \EMPORIKO\Controllers\Pages\View(null);
		$refurl=current_url(FALSE,TRUE);
		$refurl=Str::endsWith($refurl,'/logout') ? site_url() : $refurl;
		
		if ($request->getGet('resetkey'))
		{
			$key=$this->decodeForgetKey($request->getGet('resetkey'));
			if (!is_array($key) && !$key)
			{
				$error=createErrorMessage('system.auth.forget_invalid_key','danger');
				goto login_form;
			}
			$view->setFile('@views/Auth/login_recover')
			     ->addData('form_hidden',['refurl'=>base64url_encode(site_url()),'action'=>'recover','key'=>$request->getGet('resetkey')])
				 ->addData('error_pass_len',createErrorMessage('system.auth.recover_error_pass_len','danger',TRUE))
				 ->addData('error_pass_equal',createErrorMessage('system.auth.error_pass_equal','danger',TRUE));
		}else
		if ($request->getGet('forget'))
		{
			$view->setFile('@views/Auth/login_forget')
			     ->addData('form_hidden',['refurl'=>$request->getGet('forget'),'action'=>'forget']);
		}else
		{
			login_form:
			$view->setFile('@views/Auth/login_form')
			     ->addData('form_hidden',['refurl'=>$refurl,'action'=>'login'])
				 ->addData('url_forget',url('$',null,[],['forget'=>current_url(FALSE,TRUE)]));
		}
		$view->addData('error',$error)
			 ->addData('_loginPage',parsePath('@views/Auth/login_index',TRUE));
		//echo $view->render();exit;
		$parser=service('viewRenderer',FALSE);
		
		echo $parser->setData($view->getViewData())->render($view->getFile());
                echo '<!-- /'.config('App')->APPName.' ver '.config('App')->APPVersion.'-->';
                exit;
	}
	
	public function Login(array $post=[])
	{
		$this->logout(FALSE);
		
		$post=count($post)<2?$_POST:$post;
		
		if (!Arr::KeysExists(['login','password'], $post))
		{
			return $this->setMessage('error fields',FALSE);
		}
		
		$post['email']=null;
		
		if (Str::contains($post['login'],"@"))
		{
			$post['email']=$post['login'];
			$post['username']=null;
		}
		
		$user=$this->modelUsers->getUserData($post['login'],null,$post['login']);
		
		if ($user==null || (is_array($user) && ((array_key_exists('enabled', $user) && $user['enabled']==0) || (array_key_exists('group_enabled', $user) && $user['group_enabled']==0))))
		{
			return $this->setMessage(lang('system.auth.loginform_error'),FALSE);
		}
                
                if ((!config('App')->isLive) && !in_array($user['username'], $this->modelUsers->getSuperAdminUsers('username')))
                {
                    return $this->setMessage('system.errors.offline',FALSE);
                }
                
		if (!password_verify($post['password'], $user['password']))
		{
			return $this->setMessage(lang('system.auth.loginform_error'),FALSE);
		}
		unset($user['password']);
		
		
		$this->createSessionToken($user);
	
		$this->modelUsers->clearResetKey($user['username']);
		$this->modelUsers->setUserStatus($user['email'],TRUE);
		
		return $this->setMessage(null,TRUE);
	}
	
	function checkCredentials($user,$pass)
	{
		$user=$this->modelUsers->getUserData($user,null,$user);
		if ($user==null || (is_array($user) && ((array_key_exists('enabled', $user) && $user['enabled']==0) || (array_key_exists('group_enabled', $user) && $user['group_enabled']==0))))
		{
			return FALSE;
		}
		
		if (!password_verify($pass, $user['password']))
		{
			return FALSE;
		}
		return TRUE;
	}
	
	public function generateForgetKey($email)
	{
		$email=$this->modelUsers->where('email',$email)->first();
		if (is_array($email))
		{
			$key=Str::base64url_encode($this->cryptor->encrypt(date('dmYHis')));
			$this->modelUsers->save(['userid'=>$email['userid'],'resetkey'=>$key]);
			$settings=model('Settings/SettingsModel')->get('system.mailer_mailtpl');
			
			$settings=str_replace(['%key_url%','%name%','%siteurl%'],[url(site_url(),null,[],['resetkey'=>$key]),$email['name'],site_url()], lang('system.auth.forget_emailmsg'));
			
			$mailer=\Config\Services::email();
			//$mailer->setFrom($settings['mailer_fromemail'], lang('system.general.mailer_from_name'));
			$mailer->setTo($email['email']);
			//$mailer->setBCC($settings['mailer_systemadminemail']);

			$mailer->setSubject(lang('system.auth.forget_reset_email_sbj'));
			$mailer->setMessage($settings);

			return $mailer->send();
		}
		return FALSE;
	}
	
	public function decodeForgetKey($key)
	{
		$record=$this->modelUsers->where('resetkey',$key)->first();
		if ($record==null)
		{
			return FALSE;
		}
		$key=$this->cryptor->decrypt(Str::base64url_decode($key));
		return $record;
	}
	
	public function hasAccess($level)
	{
		$logedUser=$this->getLogedUserInfo();
                if ($level==$logedUser['username'])
                {
                    return TRUE;
                }
                
		if (!is_array($logedUser))
		{
			return FALSE;
		}
		
		if (!array_key_exists('access',$logedUser))
		{
			return FALSE;
		}
		if (array_key_exists('accessgroups', $logedUser) && Str::contains($logedUser['accessgroups'],strval($level)))
		{
			return TRUE;
		}
		
		if (Str::contains($logedUser['access'],strval($level)))
		{
			return TRUE;
		}
		
		return FALSE;
	}
	
	
	public function logout($recordMovement=TRUE,$redirect=TRUE)
	{
		$user=$this->getLogedUserInfo();
		$this->modelUsers->setUserStatus($user['email'],FALSE);
		$this->session->removeTempdata($this->authTokenName);
		
		if (strlen($user['username']) > 0 && $user['username']!='guest' && $recordMovement)
		{
			//model('System/MovementsModel')->addItem(1,$user['username'],null,null,$user['username'],'logout',null,'user');
		}
		return $redirect ? redirect()->to(site_url()) :TRUE;
	}
	
	function createSessionToken(array $userid,$tokenName=null)
	{
		$tokenName=$tokenName==null?$this->authTokenName:$tokenName;
		$userid=$this->cryptor->encrypt(json_encode(['userid'=>$userid['userid'],'lastlogin'=>date($this->timeFormat)]));	
		$this->session->setTempdata($tokenName,base64_encode($userid),$this->sessionTime);
	}
	
	private function decryptSessionToken()
	{
		return json_decode($this->cryptor->decrypt(base64_decode($this->session->get($this->authTokenName))),TRUE);
	}
	
	private function setMessage($message,$status)
	{
		if ($this->showErrorMsg==1&&$message!=null)
		{
			$this->session->setFlashdata('error_login', $message);
		}
		if (!$status&&$this->errorRedirect!=0)
		{
			
		}else
		if ($status&&$this->successRedirect!=0)
		{
			
		}else
		{
			return $status;	
		}
	}
}
